import React, { Component } from 'react';
import Product from '../Product';
import LiveOffer from './LiveOffer'
import Title from '../Title';

import axios from 'axios';
import fs from 'fs';


export default class EndOffer extends Component {


    state  = {
        products: []
    }

    renderOffers = () => {
        if(this.state.products.length == 0){
            return
        }
        return this.state.products.map(products => {
            return (
                <LiveOffer key={products.id} product={products}/>
            )
        })
    }




    componentDidMount = () => {
        axios.get('https://autorentserver.azurewebsites.net/api/offers/user',{
            headers : {
                'language':'pl',  
                'auth-token':this.props.userdata.authToken
		    }
        })
        .then(  (response) => {
            console.log(response.data)
            this.setState({
                products: response.data
            })
        })
    }

    render() {
        return (
            <React.Fragment>
                <div className="py-5">
                    <div className="container">
                        <Title name="dostÄ™pne" title="oferty" />
                        <div className="row">
                            {
                                this.renderOffers()
                            }
                        </div>
                    </div>
                </div>
            </React.Fragment>
            //<Product></Product>
        );
    }
}
